  const Menu = [
   
    {
      link: "inventory",
      text: "Inventory",
    },
    {
      link: "sales",
      text: "Sales",
    },
  ,
    {
      link: "bills",
      text: "Bills",
    },
    {
      link: "PromoCode",
      text: "PromoCode",
    },
    {
      link: "settings",
      text: "Settings",
    },
    {
      link: "Logout",
      text: "Logout",
    },
  ]
